  <script>
const fallbackCopyTextToClipboard = (text) => {
  const textArea = document.createElement('textarea');
  let successful = false;
  textArea.value = text;

  // Avoid scrolling to bottom
  textArea.style.opacity = '0';
  textArea.style.top = '0';
  textArea.style.left = '0';
  textArea.style.position = 'fixed';

  document.body.appendChild(textArea);
  textArea.focus();
  textArea.select();

  try {
    successful = document.execCommand('copy');
    const msg = successful ? 'successful' : 'unsuccessful';
    if (!successful) console.log('Copying text command was ' + msg);
  } catch (err) {
    console.error('Oops, unable to copy', err);
  }

  document.body.removeChild(textArea);
  return successful;
};

const copyTextToClipboard = async (text) => {
  if (!navigator.clipboard) {
    return fallbackCopyTextToClipboard(text);
  }

  try {
    await navigator.clipboard.writeText(text);
    return true;
  } catch (err) {
    return fallbackCopyTextToClipboard(text);
  }
};

const btn = document.querySelector('.btn')
btn.addEventListener('click', () => {copyTextToClipboard(`javascript:(function(){%0Aconst%20script%20%3D%20document.createElement('script')%0Ascript.src%20%3D%20'https%3A%2F%2Fcdn.jsdelivr.net%2Fgh%2Faquaductape%2Fcheatle%40ca81e064ef163121bc83ac3a38931acf2cf7b595%2Fdist%2Findex.js'%0Adocument.head.appendChild(script)%0A})()`)})
</script>
